import React from 'react'

function Missao(props) {

    return (<>
        <div className="row">
                <div className="col-lg-3">
                    {props.missao.getUm()}
                </div>
                <div className="col-lg-3">
                    {props.missao.getDois()}
                </div>
        </div>
    </>)
}

export default Missao;
